import React from 'react';
import styled from 'styled-components';

const Div=styled.div`
  padding: 0 4px;
  height:122px;
`
const Img=styled.img`
  width:56px;
  height:56px;
  border-radius:50%;
  border:solid 3px transparent;
  background-image: linear-gradient(#FC466B, #3F5EFB);
  border-image-slice: 1;
  overflow:hidden;
  margin: 0 auto;
`
const Name=styled.div`
  font-size:12px;
  color:#262626;
  overflow:hidden;
  margin-top:5px;
  text-overflow:ellipsis;
  postion:absolute;
  top:50px;
`
function StoryEle() {
  return (
   <Div>
      <Img src='images/activeStatus/photo.png'/>
      <Name>growing_beomeo</Name>
   </Div>
  );
}

export default StoryEle;
